,sans-serif\">1 : 0</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:solid windowtext 1.0pt; width:75.6pt; border-top:none; border-left:none; border-right:solid windowtext 1.0pt; padding:0cm 5.4pt 0cm 5.4pt\" width=\"101\">\r\n			<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">1 : 0,5</span></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:solid windowtext 1.0pt; width:75.6pt; border-top:none; border-left:none; border-right:solid windowtext 1.0pt; padding:0cm 5.4pt 0cm 5.4pt\" width=\"101\">\r\n			<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">1 : 0,5</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><strong><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">Примечания:</span></span></span></strong></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">1. При напластовании различных видов грунта крутизну откосов для всех пластов надлежит назначать по наиболее слабому виду грунта.</span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">2. Крутизна откосов выемок глубиной более 5 м во всех случаях и глубиной менее 5 м при гидрогеологических условиях и видах грунтов, не предусмотренных п. 2.1 исчислений объемов работ и приложением 1.10, должна устанавливаться проектом.</span></span></span></p>\r\n\r\n<p style=\"margin-bottom:.0001pt; margin:0cm 0cm 10pt\"><span style=\"font-size:11pt\"><span style=\"line-height:normal\"><span style=\"font-family:Calibri,sans-serif\">3. При невозможности применения инвентарных креплений стенок котлованов или траншей следует применять крепления, изготовленные по индивидуальным проектам, утвержденным в установленном порядке.</span></span></span></p>',8,46,4),(50,'Показатели разрыхления грунтов и пород','<p><span style=\"font-size:14px;\">При разработке грунта в отвалах или насыпях пересчет объема грунта, замеренного в отвале или насыпи, в объем грунта, соответствующий объему в состоянии естественной плотности, производится по следующим правилам:</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px;\">для грунтов, пролежавших в отвале свыше четырех месяцев или подвергавшихся механическому уплотнению, при объеме работ свыше 1000 м3-с учетом фактического разрыхления грунта, устанавливаемого на основании заключения полевой грунтовой лаборатории, а при отсутствии лаборатории - на основании акта, утверждаемого начальником участка;</span></p>\r\n\r\n<p><span style=\"font-size:14px;\">для грунтов, пролежавших в отвале свыше четырех месяцев или подвергавшихся механическому уплотнению, при объеме работ до 1000 м3- по показателям графы &quot;Остаточное разрыхление грунтов в % таблицы показателей&quot;;</span></p>\r\n\r\n<p><span style=\"font-size:14px;\">для грунтов, пролежавших в отвале менее четырех месяцев и не подвергавшихся механическому уплотнению, - по показателям графы &quot;Первоначальное увеличение объема грунта после разработки в % таблицы показателей&quot;.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p style=\"text-align: center;\"><strong><span style=\"font-size:14px;\">№ п.п.</span></strong></p>\r\n			</td>\r\n			<td>\r\n			<p style=\"text-align: center;\"><strong><span style=\"font-size:14px;\">Наименование грунта</span></strong></p>\r\n			</td>\r\n			<td>\r\n			<p style=\"text-align: center;\"><strong><span style=\"font